div.div:
#include <iostream>
int main(int argc, char** argv) {
std::cout << "Hello, World!" << std::endl;
return 0;
}
Функция main является входной точкой исполняемой программы (в Windows имеет расширение .exe, в Linux не имеет стандартного расширения). Именно отсюда начнется выполнение всей логики, написанной в коде.
main возвращает целочисленное значение типа int. По соглашению в случае успешного завершения программы, она возвращает 0. Любое другое возвращаемое число будет означать ошибку. В Linux посмотреть возвращаемое значение последнего запущенного приложения можно с помощью команды echo $?. В Windows echo %errorlevel%.
